import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import {BrowserRouter as Router, Route} from 'react-router-dom';

const App=()=> {
  return (
    <Router>
    <div >
      <header>
        <h1>
          Home Page
        </h1>
      <Route/>
      </header>
    </div>
    </Router>
  );
} 

export default App;



